import React, { useEffect } from 'react'

import { Helmet } from 'react-helmet'

import './home.css'
import { Button } from 'antd';


const Home = (props) => {

  const [showDot1, setShowDot1] = React.useState(0);
  const [showDot2, setShowDot2] = React.useState(0);
  const [showDot3, setShowDot3] = React.useState(0);
  const [showDot4, setShowDot4] = React.useState(0);
  const [turns, setTurns] = React.useState(0);

  const avatars = [["Blue",showDot1],
  ["Pink",showDot2],
  ["Purple",showDot3],
  ["Orange",showDot4],
  ];


  function movePlayer(playerTurn,position) {
    fetch("/updatePosition", {
      method: "PUT",
      body: JSON.stringify({
          name: playerTurn,
          position: position
      }),
      headers: {
          "Content-type": "application/json; charset=UTF-8"
      }}).then(async response => {
      try {
       const data = await response.json()
       if(turns%4 === 0){ setShowDot1(data);}
       if(turns%4 === 1){ setShowDot2(data);}
       if(turns%4 === 2){ setShowDot3(data);}
       if(turns%4 === 3){ setShowDot4(data);}
       if(data === 100){
         const message = "Player " + playerTurn+ " won ";
         document.getElementById("message").textContent=message;
         document.getElementById("roll").disabled = true;
         updateStatus(playerTurn);
         return true;
        }
        return false;
     } catch(error) {
       console.log('Error happened here!')
     }
    })
  }
  function rollDice() {
    let playerTurn = avatars[turns%4][0];
    let dice1 = Math.floor(Math.random() * 6)+1;;
    let dice2 = Math.floor(Math.random() * 6)+1;;
    let isDouble = false;
    let doubleMsg = "";
    let message;
    if(dice1 === dice2){isDouble = true; doubleMsg = " It's double " + playerTurn + " will roll another dice"}
    else{isDouble = false}
    let rolled = dice1+dice2;
    let position = avatars[turns%4][1]+rolled;
    if(position > 100){position = 200 -position;}
    const isFinished = movePlayer(playerTurn,position);
    if(!isFinished){    
      message = "Player " + playerTurn+ " rolled " + rolled + "." + doubleMsg;
      document.getElementById("message").textContent=message;}
    if(!isDouble){
      setTurns(turns+1);
      playerTurn = avatars[(turns+1)%4][0];
      message = message + " Next Turn is " + playerTurn ;
      document.getElementById("message").textContent=message;
    }
  }

